import React from "react";
import "./searchedItems.css";
export default function SearchedItems() {
  return (
    <div>
      <div className="searchedItemContainer">
        <div className="searchedItemPhotoContainer">
          <img className="searchedItemPhoto" src="./banner1.jpeg" alt="" />
        </div>
        <div className="searchedItemInfoContainer">
          <div className="searchedItemInfoName">
            iPhone 13 Pro Max (8+256) space grey 100% new{" "}
          </div>
          <div className="searchedItemInfoDescription">this is a desc</div>
          <div className="searchedItemInfoPrice">$9999</div>
          <div className="searchedItemInfoUserName">d7willy</div>
        </div>

        <div className="right">
          <div className="searchedItemInfoVisitCount">99 visit</div>
          <div className="searchedItemInfoPostTime">5 mins ago</div>
        </div>
      </div>
    </div>
  );
}
